// Axios use
export const { lg_api } = axios.create({
    baseURL: "http://0.0.0.0:8001/",
    headers: {
      "Content-Type": "application/json; charset=utf-8",
    },
  });

import { HeadMenu } from "./HeadMenu";
import { ListPosts } from "./ListPosts";

export { HeadMenu, ListPosts };
